import React from 'react';
import axios from 'axios';
//import Card from '../Card/Card'


class Aside extends React.Component {
  state = {
    cards: []
  }

  componentDidMount() {
    axios.get('/data.json')
    .then(res => this.setState({cards: res.data}))
  }

  render() {
    return (
      <div>
        <div>
          {cards.map(card => <div>{cards.image}</div>)} 
        </div>
      </div>
    )
  }
}


export default Aside;
